}
const tooltipClasses = generateUtilityClasses('JoyTooltip', ['root', 'tooltipArrow', 'arrow', 'touch', 'placementLeft', 'placementRight', 'placementTop', 'placementBottom', 'colorPrimary', 'colorDanger', 'colorInfo', 'colorNeutral', 'colorSuccess', 'colorWarning', 'colorContext', 'sizeSm', 'sizeMd', 'sizeLg', 'variantPlain', 'variantOutlined', 'variantSoft', 'variantSolid']);
